"use strict";angular.module("yoPenguinsApp",["ngCookies","ngResource","ngSanitize","ui.router","ui.bootstrap"]).config(["$stateProvider","$urlRouterProvider","$locationProvider",function(a,b,c){b.otherwise("/"),c.html5Mode(!0)}]),angular.module("yoPenguinsApp").controller("MainCtrl",["$scope","$http",function(a,b){}]),angular.module("yoPenguinsApp").config(["$stateProvider",function(a){a.state("main",{url:"/",templateUrl:"app/main/main.html",controller:"MainCtrl"})}]),angular.module("yoPenguinsApp").factory("Modal",["$rootScope","$modal",function(a,b){function c(c,d){var e=a.$new();return c=c||{},d=d||"modal-default",angular.extend(e,c),b.open({templateUrl:"components/modal/modal.html",windowClass:d,scope:e})}return{confirm:{"delete":function(a){return a=a||angular.noop,function(){var b,d=Array.prototype.slice.call(arguments),e=d.shift();b=c({modal:{dismissable:!0,title:"Confirm Delete",html:"<p>Are you sure you want to delete <strong>"+e+"</strong> ?</p>",buttons:[{classes:"btn-danger",text:"Delete",click:function(a){b.close(a)}},{classes:"btn-default",text:"Cancel",click:function(a){b.dismiss(a)}}]}},"modal-danger"),b.result.then(function(b){a.apply(b,d)})}}}}}]),angular.module("yoPenguinsApp").controller("NavbarCtrl",["$scope","$location",function(a,b){a.menu=[{title:"Home",link:"/"}],a.isCollapsed=!0,a.isActive=function(a){return a===b.path()}}]),angular.module("yoPenguinsApp").run(["$templateCache",function(a){a.put("app/main/main.html",'<header class=hero-unit id=banner><div class=container><h1>Penguins</h1><p class=lead>Learn all about Penguins here</p></div></header><br><center><img width=80% src="http://www.defenders.org/sites/default/files/styles/large/public/penguin-joan-cambray.jpg"></center><h1>BASIC FACTS ABOUT PENGUINS</h1><p>Penguins are aquatic, flightless birds that are highly adapted to life in the water. Their distinct tuxedo-like appearance is called countershading, a form of camouflage that helps keep them safe in the water. Penguins do have wing-bones, though they are flipper-like and extremely suited to swimming. Penguins are found almost exclusively in the southern hemisphere, where they catch their food underwater and raise their young on land.</p><h3>Diet</h3><strong>Staples:</strong> Krill, fish and squid.<p>In general, penguins closer to the equator eat more fish and penguins closer to Antarctica eat more squid and krill.</p><h3>Population</h3><p>The penguin species with the highest population is the Macaroni penguin with 11,654,000 pairs. The species with the lowest population is the endangered Galapagos penguin with between 6,000-15,000 individuals.</p><h3>Range</h3><p>Penguins can be found on every continent in the Southern Hemisphere from the tropical Galapagos Islands (the Galapagos penguin) located near South America to Antarctica (the emperor penguin).</p><center><img width=50% src="http://www.defenders.org/sites/default/files/penguin-range-map.jpg"></center><h3>Behavoir</h3><p>Penguins can spend up to 75% of their lives in the water. They do all of their hunting in the water. Their prey can be found within 60 feet of the surface, so penguins have no need to swim in deep water. They catch prey in their beaks and swallow them whole as they swim. Some species only leave the water for molting and breeding.</p><p>Penguins are social birds. Many species feed, swim and nest in groups. During the breeding season, some species form large groups, or “rookeries”, that include thousands of penguins. Each penguin has a distinct call, allowing individuals to find their mate and their chicks even in large groups.</p><h3>Reproduction</h3><ul><li><strong>Mating Season:</strong> Varies depending on the species, though most breed during spring and summer.</li><li><strong>Incubation:</strong> Varies from 1 month-66 days depending on the species.</li><li><strong>Number of offspring:</strong> King and emperor penguins lay one egg. All other species of penguin lay two eggs.</li></ul><footer class=footer><div class=container><p><a href=https://www.quickstartprototypes.com>Quickstart Prototypes</a> | <a href=mailto:scottnakada@gmail.com>scottnakada@gmail.com</a></p></div></footer>'),a.put("components/modal/modal.html",'<div class=modal-header><button ng-if=modal.dismissable type=button ng-click=$dismiss() class=close>&times;</button><h4 ng-if=modal.title ng-bind=modal.title class=modal-title></h4></div><div class=modal-body><p ng-if=modal.text ng-bind=modal.text></p><div ng-if=modal.html ng-bind-html=modal.html></div></div><div class=modal-footer><button ng-repeat="button in modal.buttons" ng-class=button.classes ng-click=button.click($event) ng-bind=button.text class=btn></button></div>'),a.put("components/navbar/navbar.html",'<div class="navbar navbar-default navbar-static-top" ng-controller=NavbarCtrl><div class=container><div class=navbar-header><button class=navbar-toggle type=button ng-click="isCollapsed = !isCollapsed"><span class=sr-only>Toggle navigation</span> <span class=icon-bar></span> <span class=icon-bar></span> <span class=icon-bar></span></button> <a href="/" class=navbar-brand>yo-penguins</a></div><div collapse=isCollapsed class="navbar-collapse collapse" id=navbar-main><ul class="nav navbar-nav"><li ng-repeat="item in menu" ng-class="{active: isActive(item.link)}"><a ng-href={{item.link}}>{{item.title}}</a></li></ul></div></div></div>')}]);